*/

    inputNome = () => {
        let find = document.getElementById('find');
        find.setAttribute('placeholder', 'Digite o Nome');
        
    }

    inputCpf = () => {
        let find = document.getElementById('find');
        find.setAttribute('placeholder', 'Digite o CPF')
        find.setAttribute('type', 'number');
    }

    render(){
    return (
        <div id="principal">
            <div className="form-login">                                                        
                <button type="submit" onClick={this.inputNome}>Nome</button>                                        
                <button type="submit" onClick={this.inputCpf}>CPF</button>  

            <div className="check-envio">
                <input type="text" id="find"></input> 
                <button className="enviar" type="submit">Checkin</button>  
            </div>
            </div>
        </div>
    );
  }
}

export default Checkin;
